import React from 'react';
import './table.scss';


import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPenToSquare } from '@fortawesome/free-solid-svg-icons';
import { faTrashCan } from '@fortawesome/free-solid-svg-icons';

const AircraftListHeader = () => {
  return (
    <thead className="table-header">
      <tr className="table-header-bg">
            <th className="icon-size"><input type="checkbox" /></th>
            <th>AlertId</th>
            <th>Category</th>
            <th>Message</th>
            <th>Severity</th>
            <th>Parties</th>
            <th>Status</th>
            <th>Time Detected</th>
          </tr>
    </thead>
  )
}

const AircraftListBody = (props) => {
  const deleteAircraft = () => {
    alert("削除しますか？")
  }
  const edit = () => {
    alert('編集しますか？')
  }
  return (
      <tbody className="table-body">
        <tr className="spacing-bottom">
          <td className="icon-size"><input type="checkbox" /></td>
          <td>{ props.serial_number }</td>
          <td>{ props.aircraft_name }</td>
          <td>{ props.manufacturer }</td>
          <td>{ props.model }</td>
          <td>{ props.insurance_expires_at }</td>
          <td { ...props.id } className="icon-size">
            <FontAwesomeIcon icon={faPenToSquare}  aria-hidden="tsrue" onClick={edit}/>
          </td>
          <td { ...props.id } className="icon-size">
            <FontAwesomeIcon icon={faTrashCan}  aria-hidden="tsrue" onClick={deleteAircraft}/>
          </td>
        </tr>
      </tbody>
  )
}

const AircraftTableRow = () => {
  const rows = [
    {id: 1, serial_number: "1111111", aircraft_name:"Matrice 300", manufacturer: "DJI", model: "EIDIIF", insurance_expires_at: "2020-01-01" },
    {id: 2, serial_number: "2222222", aircraft_name:"Matrice 300", manufacturer: "DJI", model: "EIDIIF", insurance_expires_at: "2020-01-01" },
    {id: 3, serial_number: "3333333", aircraft_name:"Matrice 300", manufacturer: "DJI", model: "EIDIIF", insurance_expires_at: "2020-01-01" },
    {id: 4, serial_number: "4444444", aircraft_name:"Matrice 300", manufacturer: "DJI", model: "EIDIIF", insurance_expires_at: "2020-01-01" },
    {id: 5, serial_number: "5555555", aircraft_name:"Matrice 300", manufacturer: "DJI", model: "EIDIIF", insurance_expires_at: "2020-01-01" }
  ]
  return (
    <>
      {rows.map((row) => <AircraftListBody key={row.id} serial_number={row.serial_number} aircraft_name={row.aircraft_name} manufacturer={row.manufacturer} model={row.model} insurance_expires_at={row.insurance_expires_at} />)}
    </>

  )
}


class MiniTable extends React.Component {
    render() {
         return(
           <table className="table-layout">
               <AircraftListHeader />
               <AircraftTableRow />
           </table>
         );
    }
}

export default MiniTable;
